import NavBar from '../components/NavBar';
import '../components/Background.css';
import Carousel from '../components/DisplayCard';  


const Home = ({user}) => {
    return (

      <div className='gradient-background'>
        <NavBar currentPage={'Home'} />
        <Carousel />

          <h1>Welcome to the Home Page</h1>

        <div>Welcome {user}</div> {/* Assuming loginInfo contains a 'username' property */}
      </div>

    );
  };
export default Home;
